def productExceptSelf(nums_array):
    
    # guards
    if len(nums_array) < 2 or len(nums_array) > 10 ** 5:
        return "that array won't work"
    print(nums_array, "<- starting array")
    result = []
    for idx, value in enumerate(nums_array):
        if value < -30 or value > 30:
            print("values must be between -30 and 30")
            return
        temp_arr = nums_array[:idx] + nums_array[idx+1:]
        temp_product = 1
        for num in temp_arr:
            temp_product *= num
        # print(temp_product, "<- product to add at i;", idx, "<- i")
        # print(f"{nums_array[:idx] + nums_array[idx+1:]}")
        print(temp_product, "<- current product | ", (temp_product).bit_length(), "<- its bit length")
        if temp_product.bit_length() > 32:
            print('that result is too bigâ€”must be 32 bits or less')
            break
        else:
            result.append(temp_product)
        print(result)
    
        
